Mein Tag fing heute um 5.30 Uhr an, als mein Wecker klingelte und ich drehte mich zur Seite, (wollte den Wecker ausstellen) - und rollte direkt aus dem Bett 🤦🏻‍♀️Mir war nicht bewusst, daß ich schon an der Kante lag. Aufgestanden, habe ich eine kurze Yoga Sequenz von @madymorrison gemacht, um den Tag gut zu starten. Und meine #25days25pushupschallenge habe ich auch schon heute früh erledigt ✔️

Als ich frühstückte, kam meine Matilda in die Küche, voll mit etwas, das wie Konfetti aussah..Aber nein, das war die Kissenfüllung, das sie gerade erledigt hat 🙈🤣

Heute war endlich Zeit für #gym. Ich habe mein #Intervalltraining aufm Laufband absolviert, blöderweise zeichnet die App bei Laufen auf dem Laufband keine Distanz auf. Ich hätte noch die Anzeige aufm Gerät zum nachweisen meiner Laufeinheit, wenn ich nicht versehentlich mit meiner dicken Suunto Uhr auf den Notfall Stop Knopf gekommen wäre 🙈🤦🏻‍♀️ und zack.. War alles auf Null wegen des Stops. Das war nach 3km oder so.. Ich war gerade dabei, die #3k zu knacken. Egal, danach habe ich noch zusätzlich 1.7 km gemacht, damit wenigstens die Distanz geltend gemacht werden kann für #7crun und für mein #teamblueplanet

Danach war ich durch geschwitzt und musste 50 min Krafttraining voll verschwitzt durchziehen. Ich habe Fokus gelegt wieder auf meine trapezius Muskulatur. Ich war nach den 50 Minuten so ausgelaugt, ich habe auf mein Yoga cool down verzichtet.

#gutenacht meine IG Freunde. Ein schönes Wochenende wünsche ich euch. Ich freue mich auf meinen Yoga Kurs beim @fitnessloft_gifhorn Morgen 

